import './details.css';

class Details extends Component {
    render() { 
        return (  
            <div className="details">
                <div className="about">
                    About this place
            </div>
                <div className="cntHead">
                    Cuisine
            </div>
                <div className="cntSubHead">
                    Bakery, Fast-food
            </div>
                <div className="cntHead">
                    Average Cost
            </div>
                <div className="cntSubHead">
                    ‎₹700 for two people (approx.)
            </div>
                <div></div>
            </div>
        );
    }
}

export default Details;
